import React, { Component } from 'react'

export class Cartitem extends Component {
  render() {
    return (
      <div>
        <div className="card">
            <div className="card-body">
              <div className='row'>
                  <h5 className="card-title">{this.props.eventitemdetails['refno']}</h5>
                  <p><b>{this.props.eventitemdetails['eventname']}</b></p>
              </div>
            </div>
        </div>
    </div>
    )
  }
}

export default Cartitem
